import React from "react";
import Auth from "../../components/Auth";
import InputField from "../../components/InputField";

const CreateAccount = () =>{
    return(
        <Auth title="Create your Account">
            <div className="username">
            <InputField label="First Name" type="text"/>
            <InputField label="Last Name" type="text"/>
            </div>
            <InputField label="Index Number" type="text"/>
            <InputField label="" type="text"/>
            <InputField label="Password" type="password"/>
            <InputField label="Confirm Password" type="password"/>
            <div style={{display:"flex", justifyContent:'space-between', width:'80%', marginBottom: 20}}>
                <a className="link">Already have an account?</a>
                <a className="link">Forgot password?</a>
            </div>
            <button className="submit-btn">
                LOGIN
            </button>
        </Auth>
    )
}

export default CreateAccount;
